import React from "react";

const SearchPage = () => {
  const submitForm = (e) => {
    e.preventDefault();
    this.props.history.push("/searchpage"); // <--- The page you want to redirect your user to.
  };

  return <div>Search Page!!!!!!!!</div>;
};

export default SearchPage;
